import PricingLt from "./PricingLt";
import SponsorsLt from "./SponsorLt";
import Sponsor from "../pages/Sponsor";

class PricingDubaiLt extends React.Component {
  render() {
    return (
      <React.Fragment>
        <MainBannerLt />
        <PricingLt conf="Legal" />
        <SponsorsLt conf="Legal" />
        {/* <Sponsor/> */}
